import './App.css';

const App = () =>{
  return (
  <div>
    <Header />
    <Tehnologies />
  </div>);
}

const Tehnologies = () =>{
  return(
  <div>
      <ul>
        <li>CSS</li>
        <li>HTMl</li>
        <li>JS</li>
        <li>React</li>
      </ul>
    </div>);
}

const Header = () =>{
  return (
        <div>
          <a href='#s'>Home</a>
          <a href='#s'>News Feed</a>
          <a href='#s'>Message</a>
        </div>);  
}


export default App;
